import React from 'react';
import { Link } from 'react-router-dom';

function RightFixed() {
  return (
    <div className="right-container">
      <div className="right-text">
        <h4>
          Designed and developed by <Link to="/AboutMore">Noah Jung</Link>.
        </h4>
      </div>
    </div>
  );
}

export default RightFixed;
